import { createIcon } from "../icon/createIcon";

export const CalendarIcon = createIcon(
  <svg viewBox="0 0 12 12" data-testid="CalendarIcon">
    <path d="M4 0v1h4V0h1v1h3v11H0V1h3V0h1zm7 4H1v7h10V4zM9 2H8v1h1V2zM4 2H3v1h1V2z" />
  </svg>,
  "Calendar",
  "calendar"
);
